
#!/usr/bin/env python3
import os
import sys
import base64
import tempfile
import atexit
from io import BytesIO
import tkinter as tk
from tkinter import ttk, messagebox
from PIL import Image, ImageTk

# ===== Embedded resources (auto-generated) =====
EMBEDDED_FILES = {
    'PLM.ico': """""",
    'PLM.png': """""",
    'unknownimagejpg': """"""
}

# LEGAL files will be read from the current directory of the running script
LEGAL_FILES = ['AUTHORS', 'CREDITS', 'LICENSE', 'README.md', 'README.txt', 'SECURITY.md']

# Retro UI config
BG_COLOR = "#c0c0c0"
TEXT_BG = "#f0f0f0"
TEXT_FG = "#000000"
RETRO_FONT = ("Courier New", 10)
TITLE_FONT = ("Courier New", 11)

def read_file_safe(path):
    try:
        with open(path, "r", encoding="utf-8", errors="ignore") as f:
            return f.read()
    except Exception as e:
        return f"[Error reading file]\\n{e}"

# Get bytes for a resource: prefer embedded, else read from disk
def get_resource_bytes(name):
    if name in EMBEDDED_FILES:
        return base64.b64decode(EMBEDDED_FILES[name])
    # try reading from disk (relative to current working dir)
    if os.path.isfile(name):
        with open(name, "rb") as f:
            return f.read()
    return None

# For icons that require a real file path (like .ico on Windows), write to a temp file
_temp_files = []
def write_temp_file(name, data_bytes):
    suffix = os.path.splitext(name)[1] or ""
    tf = tempfile.NamedTemporaryFile(delete=False, suffix=suffix)
    tf.write(data_bytes)
    tf.flush()
    tf.close()
    _temp_files.append(tf.name)
    return tf.name

def cleanup_temp_files():
    for p in _temp_files:
        try:
            os.remove(p)
        except Exception:
            pass

atexit.register(cleanup_temp_files)

def main():
    root = tk.Tk()
    root.title("PLM Legal & Info Viewer (Standalone)")
    root.geometry("900x600")
    root.configure(bg=BG_COLOR)

    # Try set icon: prefer embedded PLM.ico, else embedded PLM.png, else disk files
    icon_set = False
    ico_bytes = get_resource_bytes("PLM.ico")
    if ico_bytes:
        try:
            ico_path = write_temp_file("PLM.ico", ico_bytes)
            root.iconbitmap(ico_path)
            icon_set = True
        except Exception:
            icon_set = False

    if not icon_set:
        png_bytes = get_resource_bytes("PLM.png")
        if png_bytes:
            try:
                img = Image.open(BytesIO(png_bytes))
                img = img.resize((64,64), Image.LANCZOS)
                tk_icon = ImageTk.PhotoImage(img)
                root._plm_icon = tk_icon
                root.iconphoto(False, tk_icon)
                icon_set = True
            except Exception:
                icon_set = False

    style = ttk.Style()
    style.theme_use("default")
    style.configure("TNotebook", background=BG_COLOR, borderwidth=2)
    style.configure("TNotebook.Tab", background="#dcdcdc", font=TITLE_FONT, padding=[10,4])
    style.map("TNotebook.Tab", background=[("selected", "#f0f0f0")])

    notebook = ttk.Notebook(root)
    notebook.pack(fill="both", expand=True, padx=4, pady=4)

    # Legal tabs: read from current dir
    found_any = False
    for fname in sorted(LEGAL_FILES):
        if os.path.isfile(fname):
            found_any = True
            frame = ttk.Frame(notebook)
            notebook.add(frame, text=fname)
            text = tk.Text(frame, wrap="word", bg=TEXT_BG, fg=TEXT_FG, font=RETRO_FONT,
                           relief="sunken", borderwidth=2, insertbackground="black")
            text.insert("1.0", read_file_safe(fname))
            text.config(state="disabled")
            text.pack(fill="both", expand=True, padx=6, pady=6)

    if not found_any:
        messagebox.showwarning("Warning", "No LICENSE / README / related files were found in current directory.")

    # ABOUT tab: show PLM.png (from embedded or disk) with clear reason
    about_frame = ttk.Frame(notebook)
    notebook.add(about_frame, text="About")
    about_images = {}

    def load_about_tab(frame):
        for w in frame.winfo_children():
            w.destroy()

        info_frame = ttk.Frame(frame)
        info_frame.pack(fill="x", padx=10, pady=(10,0))
        label = tk.Label(info_frame, text="PLM  Project Artwork", font=("Courier New",12,"bold"), bg=BG_COLOR)
        label.pack(anchor="w")

        reason = ("nh PLM.png c t  y nh mt nhn din trc quan ca d n  "
                  "gip ngi dng nhanh nhn ra d n khi chia s, in n hoc dng trong ti liu. "
                  "nh ch hin th khi c file v khi bn m tab ny; khng b nht vo giao din chnh.")
        reason_lbl = tk.Label(info_frame, text=reason, font=("Courier New",9), bg=BG_COLOR, wraplength=760, justify="left")
        reason_lbl.pack(anchor="w", pady=(4,8))

        plm_bytes = get_resource_bytes("PLM.png")
        if not plm_bytes:
            no_img_lbl = tk.Label(frame, text="Project image (PLM.png) not found.", font=RETRO_FONT, bg=BG_COLOR)
            no_img_lbl.pack(expand=True)
            return

        try:
            img = Image.open(BytesIO(plm_bytes))
            img.thumbnail((820,420), Image.LANCZOS)
            tkimg = ImageTk.PhotoImage(img)
            about_images['plm'] = tkimg
            img_label = tk.Label(frame, image=tkimg, bg=BG_COLOR, relief="ridge", borderwidth=3)
            img_label.pack(pady=10)
        except Exception as e:
            messagebox.showerror("Error loading PLM.png", str(e))

    # Contact tab: show unknownimage (embedded or disk)
    secret_frame = ttk.Frame(notebook)
    notebook.add(secret_frame, text="Contact")
    contact_images = {}

    def load_contact_tab(frame):
        for w in frame.winfo_children():
            w.destroy()

        img_bytes = get_resource_bytes("unknownimagejpg") or get_resource_bytes("unknownimage.jpg") or get_resource_bytes("unknown.jpg")
        if not img_bytes:
            label = tk.Label(frame, text="Image not found.", font=RETRO_FONT, bg=BG_COLOR)
            label.pack(expand=True)
            return
        try:
            img = Image.open(BytesIO(img_bytes))
            img.thumbnail((800,500), Image.LANCZOS)
            tkimg = ImageTk.PhotoImage(img)
            contact_images['unknown'] = tkimg
            label = tk.Label(frame, image=tkimg, bg=BG_COLOR, relief="ridge", borderwidth=3)
            label.pack(expand=True, pady=20)
        except Exception as e:
            messagebox.showerror("Error", str(e))

    def on_tab_change(event):
        current = notebook.index("current")
        tab_text = notebook.tab(current, "text")
        if tab_text == "Contact":
            load_contact_tab(secret_frame)
        elif tab_text == "About":
            load_about_tab(about_frame)

    notebook.bind("<<NotebookTabChanged>>", on_tab_change)

    root.mainloop()

if __name__ == "__main__":
    main()
